import React from 'react'
 import '../styles/pizza.css'
function Pizza() {
    return (
        <section className="pizza">
            <div className="max-width">
                <div className="container">
                    <div className="title">Pizza</div>
                </div>
            </div>
        </section>
    )
}

export default Pizza;
